import React from 'react';

function DietOverweight2() {
  return (
    <div className="diet-page">
      <h1>Diet for Overweight Level 2</h1>
      <p>For Overweight Level 2, focus on a more structured diet plan that includes:</p>
      <ul>
        <li>Consuming a variety of vegetables and fruits.</li>
        <li>Choosing lean proteins and limiting red meat.</li>
        <li>Incorporating whole grains into every meal.</li>
        <li>Monitoring portion sizes and avoiding overeating.</li>
        <li>Drinking plenty of water and avoiding sugary beverages.</li>
      </ul>
      <p>Engaging in regular physical exercise and possibly consulting a dietitian is advised.</p>
    </div>
  );
}

export default DietOverweight2;
